import * as jsPDF from "jspdf"
var font = '';
var callAddFont = function () {
    this.addFileToVFS('Pyidaungsu-2.5_Regular-normal.ttf', font);
    this.addFont('Pyidaungsu-2.5_Regular-normal.ttf', 'Pyidaungsu-2.5_Regular', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])

export default font